import{_ as e,c as o,o as p,a as c}from"./app.644e59e4.js";const v=JSON.parse('{"title":"Vue \u751F\u547D\u5468\u671F","description":"","frontmatter":{},"headers":[],"relativePath":"handbook/vue/Vue_life_circle.md"}'),d={name:"handbook/vue/Vue_life_circle.md"},t=c('<h1 id="vue-\u751F\u547D\u5468\u671F" tabindex="-1">Vue \u751F\u547D\u5468\u671F <a class="header-anchor" href="#vue-\u751F\u547D\u5468\u671F" aria-hidden="true">#</a></h1><p><code>beforeCreate</code>\uFF1A</p><p>\u5728\u521D\u59CB\u5316 Lifecycle\u3001Events \u4E8B\u4EF6\u4E4B\u540E\u8C03\u7528\uFF0C\u6B64\u65F6data\u3001props\u8FD8\u6CA1\u88AB\u521D\u59CB\u5316\uFF0C\u4E0D\u80FD\u8BBF\u95EE\u76F8\u5173\u7684\u6570\u636E</p><p><code>created</code>:</p><p>\u5728\u8FD9\u4E2A\u94A9\u5B50\u8C03\u7528\u4E4B\u524D\uFF0C\u4F20\u5165\u7684\u6570\u636E\u548C\u65B9\u6CD5\u5DF2\u7ECF\u521D\u59CB\u5316\u5230\u5B9E\u4F8B\u4E0A\u4E86\uFF0C\u5E76\u4E14\u5DF2\u7ECF\u5B8C\u6210\u4E86\u6570\u636E\u76D1\u6D4B\u7684\u53CC\u5411\u7ED1\u5B9A\uFF0C\u8FD9\u4E2A\u9636\u6BB5\u53EF\u4EE5\u8FDB\u884C\u64CD\u4F5C\u6570\u636E\u548C\u4F7F\u7528\u65B9\u6CD5</p><p>\u5728\u8FD9\u4E2A\u94A9\u5B50\u4E2D\u8BF7\u6C42 Ajax \u6570\u636E\u662F\u6BD4\u8F83\u5408\u9002\u7684\uFF0C\u539F\u56E0\u662F\u5C3D\u65E9\u7684\u53D1\u51FA\u8BF7\u6C42\uFF0C\u53EF\u4EE5\u51CF\u5C11\u7528\u6237\u7B49\u5F85\u65F6\u95F4</p><p>\u8FD9\u4E2A\u65F6\u5019\uFF0C\u5B9E\u4F8B\u8FD8\u6CA1\u6709\u6302\u8F7D\uFF0C\u6240\u4EE5\u4E0D\u53EF\u4EE5\u8FDB\u884C\u6709\u5173DOM\u7684\u64CD\u4F5C</p><p><code>beforeMount</code>:</p><p><code>mounted</code>:</p><p>\u5728\u8BE5\u94A9\u5B50\u88AB\u8C03\u7528\u65F6\uFF0CVue\u5B9E\u4F8B\u5DF2\u7ECF\u6210\u529F\u6302\u8F7D\u5728\u9875\u9762\u4E0A\u4E86\uFF0C$el\u5DF2\u7ECF\u66FF\u6362\u4E3A\u751F\u6210\u7684DOM\uFF0C\u5E76\u4E14\u66FF\u6362\u6389\u4E86\u9875\u9762\u7684\u539F\u6765\u7684$el\uFF0C\u5E76\u4E14\u5BF9\u5E94\u7684\u6570\u636E\u548C\u89C6\u56FE\u5DF2\u7ECF\u5F62\u6210\u53CC\u5411\u7ED1\u5B9A\u3002\u5728\u8FD9\u91CC\u53EF\u4EE5\u8FDB\u884C\u4E00\u4E9BDOM\u76F8\u5173\u7684\u64CD\u4F5C</p><p><code>beforeUpdate</code>:</p><p>Vue\u7684\u6570\u636E\u66F4\u65B0\u5BFC\u81F4\u89C6\u56FE\u66F4\u65B0\u662F\u4E00\u4E2A\u5F02\u6B65\u7684\u8FC7\u7A0B\uFF0C\u5728\u4E00\u6B21\u4E8B\u4EF6\u5FAA\u73AF\u8FC7\u7A0B\u4E2D\uFF0C\u65E0\u8BBA\u6539\u53D8\u4E86\u591A\u5C11\u4E2A\u6570\u636E\u6216\u540C\u4E00\u4E2A\u6570\u636E\u4FEE\u6539\u4E86\u591A\u5C11\u6B21\uFF0C\u6700\u7EC8\u90FD\u53EA\u4F1A\u6267\u884C\u4E00\u6B21\u89C6\u56FE\u66F4\u65B0\u3002</p><p>beforeUpdate\u662F\u5728\u89C6\u56FE\u66F4\u65B0\u524D\u8C03\u7528\uFF0C\u6240\u4EE5\u5728\u8FD9\u91CC\u6211\u4EEC\u80FD\u53D6\u5230\u6240\u6709\u6539\u53D8\u7684\u6570\u636E\uFF0C\u5E76\u4E14\u8FDB\u884C\u6700\u540E\u4E00\u6B21\u4FEE\u6539</p><p><code>updated</code>:</p><p><code>activated</code>:</p><p>\u5728\u4F7F\u7528 vue-router \u5E76\u4E14\u4F7F\u7528keep-alive\u7F13\u5B58\u8DEF\u7531\u9875\u9762\u65F6\u89E6\u53D1\u3002</p><p>\u6BD4\u8F83\u7ECF\u5178\u7684\u4F7F\u7528\u573A\u666F\u662F\u7F13\u5B58\u6EDA\u52A8\u6761\u7684\u4F4D\u7F6E\u3002<code>vue-router</code>\u5207\u6362\u4E0D\u540C\u8DEF\u7531\u7684\u65F6\u5019\uFF0C\u5373\u4F7F\u6211\u4EEC\u4F7F\u7528 <code>keep-alive</code>\u4E5F\u4E0D\u4F1A\u7F13\u5B58\u6EDA\u52A8\u6761\u7684\u4F4D\u7F6E\uFF0C\u6240\u4EE5\u8FD9\u4E2A\u65F6\u5019\u53EA\u9700\u8981\u8BB0\u4F4F<code>scrollTop</code>\u5B58\u653E\u5728\u5F53\u524D\u5B9E\u4F8B\u4E2D\uFF0C\u56E0\u4E3A\u4F7F\u7528\u7F13\u5B58\uFF0C\u6240\u4EE5\u5F53\u5207\u6362\u5230\u5176\u5B83\u8DEF\u7531\u65F6\uFF0C\u8FD9\u4E2A\u5B9E\u4F8B\u4E5F\u4E0D\u4F1A\u9500\u6BC1\uFF0C\u5F53\u518D\u6B21\u6FC0\u6D3B\u65F6\uFF0C\u4F1A\u89E6\u53D1\u8FD9\u4E2A\u751F\u547D\u5468\u671F\u51FD\u6570\uFF0C\u5C06scrollTop\u8D4B\u503C\u7ED9\u6EDA\u52A8\u5143\u7D20\uFF0C\u5C31\u53EF\u4EE5\u7F13\u5B58\u6EDA\u52A8\u6761\u7684\u4F4D\u7F6E\u3002</p><p>\u53E6\u4E00\u4E2A\u573A\u666F\u662F\uFF0C\u6839\u636E\u8DEF\u7531\u53C2\u6570\u5237\u65B0\u8DEF\u7531\u9875\u9762\u7684\u6570\u636E</p><p>deactivated:</p><p>beforeDestory:</p><p><code>destroyed</code>:</p><p>\u5B9E\u4F8B\u9500\u6BC1\u540E\u8C03\u7528\u3002\u8BE5\u94A9\u5B50\u88AB\u8C03\u7528\u540E\uFF0C\u5BF9\u5E94Vue\u5B9E\u4F8B\u7684\u6240\u6709\u6307\u4EE4\u90FD\u88AB\u89E3\u9664\u7ED1\u5B9A\uFF0C\u6240\u6709\u7684\u4E8B\u4EF6\u76D1\u542C\u88AB\u79FB\u9664\uFF0C\u6240\u6709\u7684\u5B50\u5B9E\u4F8B\u4E5F\u90FD\u88AB\u9500\u6BC1\u3002\u4F46\u9700\u8981\u6CE8\u610F\u7684\u662F\uFF0C\u5982\u679C\u7ED9\u4E00\u4E2ADOM\u7ED1\u5B9A\u4E00\u4E2Aclick\u4E8B\u4EF6\uFF0C\u90A3\u4E48\u8BE5\u4E8B\u4EF6\u4E0D\u4F1A\u88AB\u9500\u6BC1\uFF08\u5373\u539F\u751F\u4E8B\u4EF6\u4E0D\u4F1A\u88AB\u89E3\u9664\uFF09</p>',22),a=[t];function r(_,i,s,l,n,u){return p(),o("div",null,a)}var h=e(d,[["render",r]]);export{v as __pageData,h as default};
